//import 'aframe';
import { Scene, Entity } from 'aframe-react';
import React from 'react';


 
function VREx() {

  return (
    <div>
 <a-scene>
      <a-assets >
        <a-asset-item id="ring" src="Images/scene.gltf"/>
      
        <a-asset-item id="url" src="Images/90a30469-f038-4054-be9c-fd1ec94a810d_kitchentest.glb"/>
     
         </a-assets>
    
     <a-entity gltf-model="#ring" scale="60 60 -77" rotation="1.00 1.00 -5.00" position="2 3 -10">
     </a-entity>
    </a-scene> 
    </div>
    );
}


export default VREx;
